import React from "react";
import WorkoutFilter from "../Components/WorkoutFilter";
import "./styles/Workouts.css";

function Workouts() {
  const mockData = [
    { name: "Workout 1", goal: "Weight lost", equipment: "Equipment 1" },
    { name: "Workout 2", goal: "Muscle Gain", equipment: "Equipment 2" },
    { name: "Workout 3", goal: "Musscle ", equipment: "Equipment 3" },
  ];

  return (
    <div className="Workout-page">
      <div className="header">
        <h1>Workouts</h1>
      </div>
      <div className="filter">
        <WorkoutFilter></WorkoutFilter>
      </div>
      <div className="list">
        {mockData.map((workout, index) => (
          <div className="Workout-details" key={index}>
            <p>{workout.name}</p>
            <p>Goal: {workout.goal}</p>
            <p>Equipment: {workout.equipment}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Workouts;
